/*! \file gaunt_factor.c
 *  \brief Function definitions of routines for calculating free-free and bound-free Gaunt factors.
 *
 *  The free-free Gaunt factors follow Sutherland 1998, MNRAS, 300, 321-330.
 *  
 *  http://adsabs.harvard.edu/abs/1998MNRAS.300..321S
 *
 *  The bound-free Gaunt factors follow Karzas and Latter 1961, ApJS, 6, 167
 * 
 *  http://adsabs.harvard.edu/abs/1961ApJS....6..167K
 *
 *
 *   Note this code only works at E*Ry >~ 1.0e-3.
 *   Small energies cause instability in the sigma_nl_l->E's.
 */
#include<stdio.h>
#include<math.h>
#include<gsl/gsl_sf_gamma.h>
#include<gsl/gsl_interp.h>
#include"gaunt_factor.h"
#include"constants.h"



/*! \var gsl_spline *gff_spline
 *  \brief GSL spline for velocity-averaged free-free Gaunt factor. */
gsl_spline *gff_spline;
/*! \var gsl_interp_accel *gff_accel
 *  \brief GSL interp accel for velocity-averaged free-free Gaunt factor. */
gsl_interp_accel *gff_acc;
/*! \var int gffint_flag
 *  \brief Flag to indicate whether the gff spline interpolant has been initialized. */

int gffint_flag;

/*! \class Constants C_gaunt;
 *  \brief A Constants instance used for convenience.
 */
Constants C_gaunt;

/*! \fn double acot(double x) 
 *  \brief Simple arccot function.
 */
double acot(double x)
{
	return C_gaunt.pi/2. - atan(x);
}
/*! \fn double g_bf_ave(int n, double E, double Z)
 *  \brief The shell (l) - averaged bound-free Gaunt factor
 */
double g_bf_ave(int n, double E, double Z)
{
	//shell-averaged
	double gbf=0;

	for(int l=0;l<n;l++)
		gbf += (2*l+1)*g_bf(n,l,E,Z);
	//return average
	return gbf/pow(n,2);
}

/*! \fn double g_bf(int n, int l, double E, double Z)
 *  \brief Bound-free Gaunt factor calculated following
 *  Karzas and Latter 1961.
 *
 *  The bound free Gaunt factor is defined as
 *
 *  - \f$ g_{bf} = \frac{\sigma_{bf}}{\sigma_{bf}^{K}} \f$
 *
 *  where 
 *
 *  - \f$ \sigma_{bf} \f$ is the quantum-mechanical bound-free cross-section, see sigma_nlelm1()+sigma_nlelp1()
 *  - \f$ \sigma_{bf}^{K{ \f$ is the semi-classical Kramer's cross-section, see sigma_kramers()
 *
 *  For reference, see equation 40 of Karzas and Latter 1961.
 */
double g_bf(int n, int l, double E, double Z)
{
	double Ein = E;
	//eqn 40 of Karzas & Latter 1961
	if(n<=0)
	{
		printf("Error n=%d<=0\n",n);
		fflush(stdout);
		exit(-1);
	}

	if(log10(E/(Z*Z*C_gaunt.rydberg_in_ergs))<=-3.0)
		Ein = 1.0e-3 *Z*Z*C_gaunt.rydberg_in_ergs;

	//note that frequency dependence divides out
	double sigma1 = sigma_nlelm1(n,l,Ein,Z); 
	double sigma2 = sigma_nlelp1(n,l,Ein,Z);
	double sigmaK = sigma_kramers(n,Ein,Z);

	//printf("E %e n %d l %d sigma1 %e sigma2 %e sigmaK %e\n",E,n,l,sigma1,sigma2,sigmaK);
	
	return (sigma1 + sigma2)/sigmaK;
}

/*! \fn double sigma_kramers(int n, double E, double Z)
 *  \brief Kramer's semi-classical bound-free cross-section.
 *
 *  Karzas and Latter 1961, equation 39
 */
double sigma_kramers(int n, double E, double Z)
{
	//eqn 39 of Karzas & Latter 1961
	double eta = sqrt( Z*Z*C_gaunt.rydberg_in_ergs/E );
	double rho = eta/((double) n);
	double cc  = C_gaunt.c_cgs;
	double ee  = C_gaunt.e_electron_cgs;
	double pi  = C_gaunt.pi;
	double m   = C_gaunt.m_electron_cgs;

	return pow(2.,4.)/(3.*sqrt(3.)) *(ee*ee/(m*cc))*(1./((double)n))*pow(rho*rho/(1.+rho*rho),2.);
}


/*! \fn double sigma_nlelm1(int n, int l, double E, double Z)
 *  \brief Cross-section for bound-free absorption from state
 *   n,l through a dipole transition to free energy E with angular
 *   momentum l-1
 * 
 *   Karzas and Latter 1961, equation 36
 */
double sigma_nlelm1(int n, int l, double E, double Z)
{
	//eqn 36 of Karzas & Latter 1961
	double eta = sqrt( Z*Z*C_gaunt.rydberg_in_ergs/E );
	double rho = eta/((double) n);

	double GlA = G_l(l,-(l+1-n),eta,rho);
	double GlB = G_l(l,-(l-1-n),eta,rho);
	double cc  = C_gaunt.c_cgs;
	double ee  = C_gaunt.e_electron_cgs;
	double pi  = C_gaunt.pi;
	double m   = C_gaunt.m_electron_cgs;
	double A,B,C,D;
	double dl = (double) l;

	A = (pi/m)*(ee*ee/(cc));

	A*=pow(2.,4.*dl)/3.;

	if(l==0)
		return 0.;

	if(l==1)
	{
		//B = 1.0 + eta*eta;
		B = log10(1.0);
	}else{

		B = log10(1.0);

		for(int ll=1;ll<l;ll++)
			B+= log10((((double) (ll*ll)) + eta*eta));
	}
	B += log10(dl*dl*gsl_sf_fact(n+l)/( gsl_sf_fact(2*l+1)*gsl_sf_fact(2*l-1)*gsl_sf_fact(n-l-1) ));

	C = log10(exp(-4.*eta*acot(rho))/(1 - exp(-2*pi*eta)));
	C+= log10(pow(rho,2.*dl+2.)/pow(1.+rho*rho, 2.*((double) n)-2.));

	D = pow( GlA - pow(1.+rho*rho,-2.)*GlB, 2. );

	A = log10(A);
	D = log10(D);
	return pow(10.0,A+B+C+D);
}


/*! \fn double sigma_nlelp1(int n, int l, double E, double Z)
 *  \brief Cross-section for bound-free absorption from state
 *   n,l through a dipole transition to free energy E with angular
 *   momentum l+1
 * 
 *   Karzas and Latter 1961, equation 37
 */
double sigma_nlelp1(int n, int l, double E, double Z)
{
	//eqn 37 of Karzas & Latter 1961
	double eta = sqrt( Z*Z*C_gaunt.rydberg_in_ergs/E );
	double rho = eta/((double) n);

	double GlA = G_l(l+1,-(l+1-n),eta,rho);
	double GlB = G_l(l+1,-(l-n),eta,rho);
	double cc  = C_gaunt.c_cgs;
	double ee  = C_gaunt.e_electron_cgs;
	double pi  = C_gaunt.pi;
	double m   = C_gaunt.m_electron_cgs;
	double A,B,C,D;
	double dl = (double) l;

	A = (pi/m)*(ee*ee/(cc));

	A*=pow(2.,4.*dl+6.)/3.;

	if(l==0)
	{
		B = log10(1. + eta*eta);
	}else{

		B = log10(1.);

		for(int ll=1;ll<=l+1;ll++)
			B+= log10((((double) (ll*ll)) + eta*eta));
	}
	B += log10(pow(dl+1.,2));
	B += log10(gsl_sf_fact(n+l));
	B -= log10(2.*dl+1.);
	B -= log10(gsl_sf_fact(2*l+1));
	B -= log10(gsl_sf_fact(2*l+2));
	B -= log10(gsl_sf_fact(n-l-1));
	B -= log10(pow((dl+1.)*(dl+1.)+eta*eta,2) );

	C = log10(exp(-4.*eta*acot(rho)));
	C-= log10((1 - exp(-2.*pi*eta)));
	C+= log10(pow(rho,2.*dl+4.)*eta*eta/pow(1.+rho*rho, 2.*n));

	D = pow( (dl+1.-n)*GlA + (dl+1.+n)*GlB/(1.+rho*rho), 2. );


	A = log10(A);
	D = log10(D);
	return pow(10.0,A+B+C+D);
}


/*! \fn double G_l(int l, int m, double eta, double rho)
 *  \brief The bound-free transition matrix element G_l.  
 *
 *  See Karzas & Latter 1961, Appendix C.
 *
 *  http://adsabs.harvard.edu/abs/1961ApJS....6..167K
 */
double G_l(int l, int m, double eta, double rho)
{
	
	//m is really -m
	double gl=0;

	for(int s=0;s<=2*m;s++)
		gl+=b_s_G_l(s,l,m,eta,rho)*pow(rho,s);

	return gl;
	
}
/*! \fn double b_s_G_l(int s, int l, int m, double eta, double rho)
 *  \brief Coefficients b_s for the polynomial solution to the 
 *  bound-free transition matrix element G_l.  
 *
 *  See Karzas & Latter 1961, Eqns C8 & C9. 
 *
 *  http://adsabs.harvard.edu/abs/1961ApJS....6..167K
 */
double b_s_G_l(int s, int l, int m, double eta, double rho)
{
	double bs;
	double bsm1;
	double bsm2;
	double dl = (double) l;
	double ds = (double) s;
	double dm = (double) m;
	//Karzas & Latter 1961, Eqns C8 & C9
	if(s==0)
		return 1.;
	if(s==1)
		return 2.*dm*eta/dl;

	bsm1 = b_s_G_l(s-1,l,m,eta,rho);
	bsm2 = b_s_G_l(s-2,l,m,eta,rho);
	bs = -(1./(ds*(ds+2.*dl-1.)))*(4.*eta*(ds-1.-dm)*bsm1 + (2.*dm+2.-ds)*(2.*dm+2.*dl+1.-ds)*bsm2);
	
	return bs;	
}
/*! \fn double g_ff_u(double T, double Z)
 *  \brief Total energy free-free Gaunt factor,
 *  averaged over frequency in the Maxwell-Boltzmann distribution
 *  of electron velocities.
 */
double g_ff_u(double T, double Z)
{
	double gamma2 = Z*Z*C_gaunt.rydberg_in_ergs/(C_gaunt.k_b_cgs*T);

	if(gffint_flag!=123)
		initialize_g_ff_u();

	return gsl_spline_eval(gff_spline,log10(gamma2),gff_acc);
}

/*! \fn void initialize_g_ff_u(void)
 *  \brief Initialization function for a spline interpolation of the
 *         frequency averaged free-free Gaunt factor.
 */
void initialize_g_ff_u(void)
{

	gffint_flag = 123;
	gff_spline = gsl_spline_alloc(gsl_interp_cspline,41);
	gff_acc    = gsl_interp_accel_alloc();

	gsl_spline_init(gff_spline,g2_int,gffint, 41);
}

/*! \fn double g_ff(double T, double Z, double nu)
 *  \brief Returns the free-free Gaunt factor as a
 *  function of temperature, ion charge, and frequency. 
 *  THIS free-free Gaunt factor is the most commonly used.
 */
double g_ff(double T, double Z, double nu)
{
	double gamma2 = Z*Z*C_gaunt.rydberg_in_ergs/(C_gaunt.k_b_cgs*T);
	double u = C_gaunt.h_planck_cgs*nu/(C_gaunt.k_b_cgs*T);
	double gff = g_ff_interpol(u,gamma2);
	return gff;
}
/*! \fn double g_ff_interpol(double u, double gamma2)
 *  \brief Returns the interpolated free-free Gaunt factor
 *   from the calculations of Sutherland 1998.
 *
 *   Interpolates in two dimensions:
 *   - \f$ u = h\nu / kT \f$
 *   - \f$ \gamma^{2} = Z^{2} \mathrm{Ry} / kT \f$
 *
 *   See http://adsabs.harvard.edu/abs/1998MNRAS.300..321S
 */
double g_ff_interpol(double u, double gamma2)
{
	int iu;
	int ig;
	double gff;
	double f00, f10, f01, f11;
	double x,y;

	ig = gsl_interp_bsearch(ggff,log10(gamma2),0,40);
	iu = gsl_interp_bsearch(ugff,log10(u),0,80);


	y = (log10(u) - ugff[iu])/(ugff[iu+1] - ugff[iu]);
	x = (log10(gamma2) - ggff[ig])/(ggff[ig+1] - ggff[ig]);


	f00 = gffgu[81*ig + iu];
	f10 = gffgu[81*(ig+1) + iu];
	f01 = gffgu[81*ig + (iu+1)];
	f11 = gffgu[81*(ig+1) + (iu+1)];

	gff = f00*(1-x)*(1-y) + f10*x*(1-y) + f01*(1-x)*y + f11*x*y;

	return pow(10.0,gff);
}



